// src/components/BookingsList.js
import React, { useEffect, useState } from 'react';
import { getAllBookings, deleteBooking } from '../api/BookingService';

function BookingsList() {
    const [bookings, setBookings] = useState([]);

    useEffect(() => {
        const fetchBookings = async () => {
            const data = await getAllBookings();
            setBookings(data);
        };
        fetchBookings();
    }, []);

    const handleDelete = async (id) => {
        await deleteBooking(id);
        setBookings(bookings.filter((booking) => booking.bookingId !== id));
    };

    return (
        <div>
            <h1>Bookings</h1>
            <ul>
                {bookings.map((booking) => (
                    <li key={booking.bookingId}>
                        {booking.bookingDate} - {booking.duration} hours
                        <button onClick={() => handleDelete(booking.bookingId)}>Delete</button>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default BookingsList;
